    public function getAllResearchers(): array
    {
        return $this->personnelData;
    }

    public function getResearcherById(string $id): ?array
    {
        foreach ($this->personnelData as $researcher) {
            if ($researcher['EmpID'] === $id) {
                return $researcher;
            }
        }
        
        return null;
    }

    public function modResearchData(): array
    {
        // Create a new array to hold modified data
        $modifiedData = [];
        
        foreach ($this->personnelData as $key => $personnel) {
            // Add the original personnel data
            $modifiedPersonnel = $personnel;
            
            // Add designation long name if found
            foreach ($this->designations as $designation) {
                if ($personnel['DesigShort'] == $designation['DesigShort']) {
                    $modifiedPersonnel['DesigLong'] = $designation['DesigLong'];
                    break; // Exit loop once found
                }
            }
            
            // Add institute long name if found
            foreach ($this->institutes as $institute) {
                if ($personnel['InstShort'] == $institute['InstShort']) {
                    $modifiedPersonnel['InstLong'] = $institute['InstLong'];
                    break;
                }
            }
            
            // Add division long name if found
            foreach ($this->divisions as $division) {
                if ($personnel['DivShort'] == $division['DivShort']) {
                    $modifiedPersonnel['DivLong'] = $division['DivLong'];
                    break;
                }
            }
            
            $modifiedData[] = $modifiedPersonnel;
        }
        
        return $modifiedData;
    }
